import RollerCoasterDetail from './RollerCoasterDetail';
import AmusementParkDetail from './AmusementParkDetail';
import RollerCoasterList from './RollerCoasterList';
import AmusementParkList from './AmusementParkList';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <Nav />
        <Switch>
          <Route path="/" exact component={Home}/>
          <Route path="/AmusementParks" exact component={AmusementParkList}/>
          <Route path="/RollerCoasters" exact component={RollerCoasterList}/>
          <Route path="/:AmusementParkID" exact component={AmusementParkDetail}/>
          <Route path="/:AmusementParkID/:RollerCoasterID" exact component={RollerCoasterDetail}/>s
        </Switch>
      </div>
    </Router>
  );
}

const Home = () => (
  <div>
    <h1>Home Page</h1>
  </div>
)

export default App;
